import React from "react";
import "./NavBarItem.css";

const NavBarItem = (props) => {
  return (
    <div className="navBarItem">
      <a href="/">
        <span className={`fa ${props.icon} fa-lg`}> {props.type}</span>
      </a>
    </div>
  );
};

export default NavBarItem;
